function setupPastConvergenceQuestion(node) {
  var question = node.querySelector('#participated_past_convergence');
  var nextLabel = node.querySelector('label[for="past_convergence"]');
  question.addEventListener('change', function (ev) {
    var val = ev.target.value;
    nextLabel.style.display = val === 'Yes' ? 'block' : 'none';
  });
}

function setupForm(node) {
  node.setAttribute('method', 'POST');
  var submissionType = node.querySelector('#submission_type');
  var container = node.querySelector('#submission-form__sections');
  var html = null;

  if (submissionType) {
    submissionType.addEventListener('change', function (ev) {
      var typeValue = ev.target.value;

      if (typeValue === 'Band') {
        html = getBandSectionHtml() + getSubmitBtnHtml();
        container.innerHTML = html;
        setupPastConvergenceQuestion(container);
      } else if (typeValue === 'DJ') {
        html = getDjSectionHtml() + getSubmitBtnHtml();
        container.innerHTML = html;
        setupPastConvergenceQuestion(container);
      } else if (typeValue === 'Talent') {
        html = getTalentSectionHtml() + getSubmitBtnHtml();
        container.innerHTML = html;
        setupPastConvergenceQuestion(container);
      } else {
        container.innerHTML = '';
      }
    });
  }
}

var init = function init() {
  var submissionForm = document.getElementById('submission-form');
  var placeholderContainer = document.getElementById('placeholder-submission-form');

  if (submissionForm) {
    setupForm(submissionForm);
    placeholderContainer.innerHTML = '';
  }
};
